  return (
    <div>
      <h1>Hats page</h1>;
    </div>
  );
};

const Topic = (props) => {
  console.log(props.location.pathname);
  return (
    <div>
      <h1>Topics list </h1>;
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <SwitchSwitch>
        <Route exact path="/" component={HomePage} />
        <Route exact path="/shop/hats" component={Hats} />
      </SwitchSwitch>
    </div>
  );
}

export default App;
